function getCommand() {
    const [command, setCommand] = useState('')
    const handleInput = (e) => {
        setCommand(e.target.value)
    }
    return{
        command,
        handleInput
    }
}

export function Input() {

    return (
      <input 
        onChange={getCommand().handleInput}
      />
    )
}
